function DBConnector(){}console.log("Functions Loaded");dbp=DBConnector.prototype;dbp.dbname="test.db";dbp.db;DBConnector.prototype.open=function(){this.openHandler=function(e){console.log("openHandler")};this.folder=Ti.Filesystem.getResourcesDirectory();this.dbFile=this.folder.resolve(this.dbname);this.db=Ti.Database.openFile(this.dbFile)};DBConnector.prototype.queryByIds=function(e){var t="SELECT * FROM ser_data WHERE ser_data.ser_id = (SELECT series_id FROM ser_id WHERE g_id LIKE "+e.g+" AND ed_id  LIKE "+e.ed+" AND ar_id LIKE "+e.ar+")";rows=this.db.execute(t);var n=JSON.parse(rows.fieldByName("observations"));$.each(n,function(e,t){str=t.date;a=str.split("-");var n=new Date(a[0],a[1],a[2]);t.jsDate=n});$.event.trigger({type:"FRED",observations:n})};